id:
Optionally provide service-specific configuration parameters in a valid JSON object in-line.
CF_NAME update-service -c '{"name":"value","name":"value"}'

Optionally provide a file containing service-specific configuration parameters in a valid JSON object. 
The path to the parameters file can be an absolute or relative path to a file.
CF_NAME update-service -c PATH_TO_FILE

Example of valid JSON object:
{
   "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

translation:
Opcionalmente, forneça parâmetros de configuração específicos do serviço em um objeto JSON válido sequencial.
CF_NAME update-service -c '{"name":"value","name":"value"}'

Opcionalmente, forneça um arquivo contendo parâmetros de configuração específicos do serviço em um objeto JSON válido. 
O caminho para o arquivo de parâmetros pode ser um caminho absoluto ou relativo para um arquivo.
CF_NAME update-service -c PATH_TO_FILE

Exemplo de objeto JSON válido:
{
   "cluster_nodes": {
      "count": 5,
      "memory_mb": 1024
   }
}

